import React from "react";
import Card from "./Card.jsx";
import contacts from "../contacts.js";


function ShowCards(){
    return  contacts.forEach(function(contact){
    <Card
        name={contact.name}
        img={contact.imgURL}
        tel={contact.phone}
        email={contact.email}
      />    
    })
}

function App() {
  return (
    <div>
     <h1 className="heading">My Contacts</h1>
     <ShowCard />     
    </div>
  );
}

export default App;
